function Button({ children, className, onChangeClick }) {
  return (
    <a
      className={` rounded-full border-2 px-3 py-2 text-sm
      text-white hover:bg-white  hover:text-black  ${className} `}
      href="#get-started"
      onClick={onChangeClick}
    >
      {children}
    </a>
  );
}

export default Button;
